interface Props{
    value: string;
}

export default function MatchesContainer({value}:Props){

    return <ul data-matches-container className="hidden">
        <li id="${index}"
            className="text-sm break-words text-gray-200 cursor-pointer hover:text-gray-900 hover:bg-lexicblue-300 p-1"
            data-key="${term}">
            <span className="bg-lexicblue-100 text-gray-900">${value}</span>
        </li>
    </ul>;
}
